query:
/*+ NoMergeJoin(mi_idx t mc) */ select count(*)
from movie_info_idx AS mi_idx
inner join title AS t
on t.id = mi_idx.movie_id AND mi_idx.info_type_id > 101 AND t.production_year < 2004
inner join movie_companies AS mc
on t.id = mc.movie_id AND mc.company_id > 133718 AND mc.company_type_id = 2;
